pragma solidity ^0.4.23;
contract TestContract {

    mapping(uint256 => uint256) uint256data;
    mapping(address => string)  stringdata;
    mapping(address => uint256) storedata;

    function setuint256(uint256 key, uint256 value) public {
        uint256data[key] = value;
    }
    
    function getuint256(uint256 key) view public returns (uint256 value) {
        value = uint256data[key];
    }
    /*
    function testtransfer(address to) public {
        to.transfer(0.01 trx);
    }*/
    
    function teststore() public payable {
        storedata[msg.sender] += msg.value;
    }

    
    function getstore(address addr) public view returns(uint256) {
        return storedata[addr];
    }
}
